import React from "react";
import Logo from './logo.svg';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";

import './style.css';

export default function Header() {
    return (
        <>
        <Router>
            <ul>
                <li className="logo">
                    <Link to="/" className="d-flex">
                        <img src={Logo} style={{
                            marginRight: "10px",
                        }} />
                    </Link>
                    <h2>Gyber.org</h2>
                </li>
                <li>
                    <ul className="d-flex space-between list">
                        <Link to="/">
                            <li>Home</li>
                        </Link>
                        <li>Philosophy</li>
                        <li>Lite Paper</li>
                    </ul>
                </li>
                <li>
                    <button className="rgbBtn">Private sale</button>
                </li>
            </ul>
        </Router>
        </>
    );
}
